  //         <li key={item.id} id={item.id}>{item.name}</li>
  //       ))}
  //     </ul>
  //   </div>
  // );
  if (Array.isArray(data)) {
    return (
      <div>
        <ul>
          {data.map((item) => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      </div>
    );
  } else {
    return <p>Error: Failed to fetch data.</p>;
  }

}

export default App;
